import React, { Component } from 'react'
import { BrowserRouter, Route, Link,Routes } from 'react-router-dom';
import BmiForm from '../bmi/BmiForm';
import { Typography } from '@mui/material';

export class App extends Component {
  render() {
    return (
      <BrowserRouter>
      <Typography> Choose what you want</Typography>
      <nav>
        <ul><li><Link to={'/BMI'}>BMI CALCULATOR</Link></li><li><Link to={'/BMI'}>CALCULATOR</Link></li></ul>
      </nav>
      <Routes>
        <Route path="/BMI" element={<BmiForm/>} />
        </Routes>
      </BrowserRouter>
    );
  }
};

export default App;
